<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8" />
    <title>sprite89</title>
</head>
<body>
<canvas id="sprite89" width="28" height="28" style="border:2px solid #cccccc;"></canvas>
<script src=".\sprite89\jaf.js"></script>
<script>
ST('sprite89', function(_f) {
    _f.setFps(31);
    _f.defaults.debug = false;
    _f.loop = true;
    // Create sprite: sprite76
    var sprite76 = new movieclip('sprite76', 1, true);
    var l0 = sprite76.layer('l0', 0);

    // Create sprite: sprite79
    var sprite79 = new movieclip('sprite79', 1, true);
    var l0 = sprite79.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .shape('shape78', './sprite89/shape78.svg', 'svg', 0, 0, 1, 0)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0]);


    // Create sprite: sprite80
    var sprite80 = new movieclip('sprite80', 7, true);
    var l0 = sprite80.layer('l0', 0);
    l0.frameclip('t0', 1, 5, 1)
    .sprite('sprite79', sprite79)
    .track('mx')
    .key(1, [0.019989, 0, 0, 0.019989, 0, 0])
    .key(3, [0.25, 0, 0, 0.25, 0, 0])
    .key(5, [0.019989, 0, 0, 0.019989, 0, 0]);

    var l1 = sprite80.layer('l1', 1);

    // Create sprite: sprite84
    var sprite84 = new movieclip('sprite84', 22, true);
    var l0 = sprite84.layer('l0', 0);
    l0.frameclip('t0', 0, 5, 1)
    .
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0])
    .key(5, [1, 0, 0, 1, 0, 0]);

    l0.frameclip('t1', 6, 12, 1)
    .
    .track('mx')
    .key(6, [1, 0, 0, 1, 0, 0])
    .key(12, [1, 0, 0, 1, 0, 0]);

    l0.frameclip('t2', 13, 20, 1)
    .
    .track('mx')
    .key(13, [1, 0, 0, 1, 0, 0])
    .key(20, [1, 0, 0, 1, 0, 0]);

    l0.frameclip('t3', 21, 21, 1)
    .shape('shape83', './sprite89/shape83.svg', 'svg', 0, 0, 1, 0)
    .track('mx')
    .key(21, [1, 0, 0, 1, 0, 0]);

    var l1 = sprite84.layer('l1', 1);
    l1.frameclip('t0', 0, 21, 1)
    .sprite('sprite80', sprite80)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0])
    .key(21, [1, 0, 0, 1, 0, 0]);

    var l2 = sprite84.layer('l2', 2);

    // Create sprite: sprite85
    var sprite85 = new movieclip('sprite85', 1, true);
    var l0 = sprite85.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .sprite('sprite84', sprite84)
    .track('mx')
    .key(0, [0.199997, 0, 0, 0.199997, 0, 0]);

    var l1 = sprite85.layer('l1', 1);

    // Create sprite: sprite86
    var sprite86 = new movieclip('sprite86', 1, true);
    var l0 = sprite86.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .sprite('sprite76', sprite76)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0]);

    var l1 = sprite86.layer('l1', 1);
    l1.frameclip('t0', 0, 0, 1)
    .sprite('sprite85', sprite85)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0]);

    var l2 = sprite86.layer('l2', 2);

    // Create sprite: sprite88
    var sprite88 = new movieclip('sprite88', 1, true);
    var l0 = sprite88.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .shape('shape87', './sprite89/shape87.svg', 'svg', 0, 0, 1, 0)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0]);


    // Create sprite: mm
    var mm = new movieclip('mm', 1, true);
    var l0 = mm.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .sprite('sprite86', sprite86)
    .track('mx')
    .key(0, [1, 0, 0, 1, 14, 14]);

    var l1 = mm.layer('l1', 1);
    l1.frameclip('t0', 0, 0, 1)
    .sprite('sprite88', sprite88)
    .track('mx')
    .key(0, [1, 0, 0, 1, 14, 14]);

    var l2 = mm.layer('l2', 2);


    _f.mc(mm);
    _f.start();
});
</script>
</body>
</html>
